(function(){"use strict";function handleClick(e){var url=e.target.getAttribute("href");if(/^(javascript|mailto|data|blob):/.test(url)){return true}if(!/\:?\/\//.test(url)&&window._Brackets_LiveDev_Transport){window._Brackets_LiveDev_Transport.send("bramble-navigate:"+url)}else{window.open(url,"_blank")}return false}addEventListener("DOMContentLoaded",function init(){var links=document.links;var len=links.length;for(var i=0;i<len;i++){links[i].onclick=handleClick}},false)})();